import React from 'react';
import { Box, Typography, List, ListItem, ListItemText } from '@mui/material';

const PortfolioCompaniesPage: React.FC = () => {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Portfolio Companies
      </Typography>
      <List>
        <ListItem>
          <ListItemText primary="Company A" secondary="Details about Company A..." />
        </ListItem>
        <ListItem>
          <ListItemText primary="Company B" secondary="Details about Company B..." />
        </ListItem>
        {/* Add more companies as needed */}
      </List>
    </Box>
  );
};

export default PortfolioCompaniesPage;
